      SELECT DISTINCT + cor2.col0 FROM tab1 (FORMAT parquet), tab1 (FORMAT parquet) cor0, tab0 (FORMAT parquet) cor1, tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q10365.out
    data: |
      7
      78
      79
